10	Em Moçambique, a violência é geralmente perpetrada por um familiar	<p><strong>Maputo, Moçambique -&nbsp;</strong>“Eu já estava cansada, precisava fazer alguma coisa, sentia-me inútil e sem força. Não podia mais ver a violência física, psicológica e verbal que a minha mãe sofria lá em casa,” disse Ana Massango, de 24 anos de idade, uma activista na Associação Sociocultural Horizonte Azul (ASCHA), em Maputo.</p><p>Ana vivia com a sua mãe e familiares em casa da sua avó, que era a responsável de casa. Após o falecimento da sua avó, um familiar de Ana passou a ser o responsável pela gestão da casa e foi aí que começou a violência contra a sua mãe. “Após a morte da minha avó, a minha mãe passou a sofrer humilhações por não trabalhar e não contribuir. Se passassem três dia sem discussão era um milagre, minha mãe sofreu muita violência e isso afectou-me muito,” disse Ana, visivelmente triste.</p><p><br></p><p><br></p><p><br></p><p>https://www.unicef.org/mozambique/historias/em-mo%C3%A7ambique-viol%C3%AAncia-%C3%A9-geralmente-perpetrada-por-um-familiar-ou-parente-%C3%ADntimo</p>	2020-04-28	2020-04-28 12:06:30.056396+00	2020-04-22	t	\N	1	1	\N	t	2020-04-30	t	1	3	1
