11	Mozambique Country Strategic Plan (2017-2021)	<p><em>Country Strategic Plan approved at EB June 2017.</em></p><p><em>Revision 03 approved by the ED in November 2018.</em></p><p><em>Revision 04 approved by the ED-DGFAO in April 2019.</em></p><p><em>Revision 05 approved by the ED-DGFAO in October 2019.</em></p><p>Mozambique achieved some hunger targets under Millennium Development Goal 1, but challenges remain in terms of Sustainable Development Goal 2, particularly with regard to chronic malnutrition rates and vulnerability to natural disasters, which are among the highest worldwide.&nbsp;</p><p>WFP’s country strategic plan (2017–2021) draws on the findings from the zero hunger strategic review, lessons learned and consultations with stakeholders. It focuses on WFP’s areas of strength that add value to the national zero hunger agenda and prioritizes support for government programmes and institutions, even when WFP plays an operational role. WFP will maintain its humanitarian assistance capacity while supporting long-term resilience and work to address the underlying causes of food insecurity and malnutrition. A gender and nutrition lens will be applied throughout the portfolio.</p><p>The following strategic outcomes will be addressed:&nbsp;</p><ol><li>Households in food-insecure areas of Mozambique are able to maintain access to adequate and nutritious food throughout the year, including in times of shock.</li><li>Shock- affected people in Mozambique are able to meet their basic food and nutrition needs&nbsp;during and immediately after a crisis.</li><li>Children in chronically food-insecure areas have access to nutritious food throughout the year.</li><li>Targeted people in prioritized areas of Mozambique have improved nutrition status in line with national targets by 2021.</li><li>Targeted smallholder farmers in northern and central Mozambique have enhanced livelihoods by 2021.&nbsp;</li><li>Humanitarian and development partners in Mozambique are reliably supported by an efficient and effective supply chain and information and communications technology services and expertise.</li></ol><p>WFP’s main partners are the Government, the Food and Agriculture Organization of the United Nations, the International Fund for Agricultural Development, the United Nations Children’s Fund, the United Nations Population Fund, UN-Women and non-governmental organizations.&nbsp;</p><p>The country strategic plan is aligned with the Government’s Vision 2025 and its Five-Year Plan&nbsp;(2015–2019), which are integrated with the Mozambique United Nations Development Assistance Framework (2017–2020), and contributes to WFP Strategic Results 1, 2, 3 and 8 in the WFP Strategic Plan (2017–2021).</p><p>&nbsp;<img src="data:image/png;base64,"></p>	2020-04-30	2020-04-30 10:14:31.262432+00	2020-04-30	t	\N	1	1	\N	t	2020-05-03	t	1	19	1
